import React from 'react';
import './MarkBtn.css';

const MarkBtn =  ({ clickedTask, toggoleTaskComplete }) => {
    var decider = clickedTask.complete;

    if (decider === false){
        return (
            <button className='MarkBtn' onClick={toggoleTaskComplete}>Mark Complete ✔</button>
        )
    } else if (decider === true){
        return (
            <button className='CompletedBtn' onClick={toggoleTaskComplete}>Mark Incomplete ✔</button>
        )
    }

}

export default MarkBtn;
